        super()
    }

render(){
    const RestaurantList = this.props.restaurantlist.map((restaurant)=>{
        return(
        <Link className='list' to='/api/auth/signup/user'>
            <p className='restaurant'>{restaurant.name}</p>
        </Link>
        )
    })
    return(
        <div>
            <h1>LISTTTTTT</h1>
        </div>
    )
}
}
